const imageOverlay = document.createElement('img');
imageOverlay.src = "data:image/jpeg;base64,";
imageOverlay.alt = "水源社区";
imageOverlay.id = "site-logo";
imageOverlay.classList.add('logo-big');

const small_logo = document.createElement('img');
small_logo.src = "data:image/jpeg;base64,";
small_logo.alt = "水源社区";
small_logo.id = "site-logo";
small_logo.width = "36";
small_logo.classList.add('logo-small');

document.getElementById("site-logo").parentElement.replaceChildren(imageOverlay);

document.addEventListener("DOMSubtreeModified", () => {
  document.getElementById("site-logo").parentElement.replaceChildren(small_logo);
});
